import React from 'react'

function Viviendas() {

    const handleClick = ()=>{
        window.open('https://www.google.com.ar/', '_blank')
        }
  return (
    <div className='sec__one'>
        <div>
        <h1> Departamentos, Townhouse y Casas</h1>
        <p>Tenemos excelentes opciones en departamentos, casas y tonwhouse para que puedas vivir en el hogar que deseas.  </p>
        <div>  <img src='https://www.canva.com/design/DAFSKScWHqU/8r8a9dV0-yDHB23l3HYmVw/view?utm_content=DAFSKScWHqU&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink'></img>
        <br></br>
        <button className='buton-categoria-inmueble' onClick={handleClick} >Ver brochure</button>
        </div>

    </div>
    </div>
  )
}

export default Viviendas;
